      new: {
        price: "$132.28",
        due: "12/20/22",
      },
      digital: {
        price: "$46.99",
        length: "180 Days",
      },
    },
    buy: {
      used: "$152.75",
      new: "$203.50",
      digital: "$81.99",
    },
  },
};

const fetch = async () => {
  let response = await fetch("TextbookInfo.json");
  let response_data = response.json();

  console.log(response_data);
};

export default function TextbookInfo() {
  const [data, setData] = useState({});

